    return ( 
        <nav> 
            <div class='titleBox'><a href="https://refugeeswelcomehome.org/"><h1>Migrant Service Map</h1></a></div>
            <div id='top_menu'>
                <a class='top-nav'>Top Nav</a>
                <a class='top-nav'>Top Nav</a>
                <a class='top-nav'>Top Nav</a>
            </div>
        </nav>
)}
}



export function Menu(props){
    return (
    <ul>
        <li>
            <h3>Service Type</h3>
                {categoryList.map(function(a){
                    return ( 
                                <div style={style.list}>
                                    <li style={style.list}>
                                        <ResourceSectionHeader category={a} />
                                    </li>
                                    <li style={style.list}>
                                        <ResourceList resourceObjects={resourceObjects} category={a}/>
                                    </li>
                                </div>
                )})}
        </li>
        <li>
            <h3>Other Criteria</h3>
        </li>
        <li>
            <h4>Visa Status</h4>
        </li>
    </ul>
    )

}
